from scipy.sparse.csgraph import floyd_warshall
i8 = np.int64
i4 = np.int32

# make_graph: (array(int64, 2d, C), array(int64, 2d, C)) -> none
# clac: (array(float64, 2d, C), int64) -> none
atcoder={
    'name': 'numba_modules',
    'file': 'numba_modules.cpython-34m.so',
    'func': ['make_graph', 'clac'],
    'gz': b''
}
import gzip, base64, os
gz = gzip.decompress(base64.b64decode(atcoder['gz']))
with open(os.path.join(os.path.dirname(__file__), atcoder['file']), 'wb') as f:
    f.write(gz)
from numba_modules import make_graph, clac
